// Wait for the DOM to fully load
document.addEventListener('DOMContentLoaded', () => {
    // Select the menu wrapper and the header-remove element
    const menuWrapper = document.querySelector('#uc_mega_menu_elementor_f89d041 .uc-mega_menu-wrapper');
    const headerRemove = document.querySelector('.header-remove');

    // Check if both elements exist to avoid errors
    if (!menuWrapper || !headerRemove) {
        console.error('One or both elements not found!');
        return;
    }

    // Define mobile breakpoint (matches your data-responsive-breakpoint="767")
    const mobileMediaQuery = window.matchMedia('(max-width: 767px)');

    // Function to update the header-remove display based on menu state
    function updateHeaderDisplay() {
        // Only apply changes if in mobile view
        if (mobileMediaQuery.matches) {
            if (menuWrapper.classList.contains('uc-menu-open')) {
                headerRemove.style.display = 'none';
            } else {
                headerRemove.style.display = 'block';
            }
        }
    }

    // Set initial state explicitly (only on mobile)
    if (mobileMediaQuery.matches) {
        headerRemove.style.display = 'block'; // Default state when page loads on mobile
    }
    updateHeaderDisplay(); // Check current state

    // Use MutationObserver to detect class changes on the menu wrapper
    const observer = new MutationObserver((mutations) => {
        mutations.forEach((mutation) => {
            if (mutation.attributeName === 'class') {
                updateHeaderDisplay();
            }
        });
    });

    // Observe changes to the class attribute of the menu wrapper
    observer.observe(menuWrapper, {
        attributes: true,
        attributeFilter: ['class']
    });

    // Optional: Handle burger menu click to ensure immediate updates
    const burger = document.querySelector('#uc_mega_menu_elementor_f89d041 .uc-mega_menu-burger');
    if (burger) {
        burger.addEventListener('click', () => {
            // Use a small timeout to ensure the class change has occurred
            setTimeout(updateHeaderDisplay, 0);
        });
    }

    // Listen for viewport changes (e.g., resizing or orientation change)
    mobileMediaQuery.addEventListener('change', () => {
        updateHeaderDisplay();
    });
});
